import React, { Component } from "react";
import './Home.css';
import homepage from "../image/Home.jpg";
import { ImageBackground, Text } from "react";

export default class Home extends Component {
  render() {
    return (
      <div className="Home">
        <div className="Page">
            <ImageBackground className="HomePage" src={homepage}>
              <Text>Welcome to the future of widgets</Text>
            </ImageBackground>
        </div>
      </div>
    );
  }
}
